  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0156072 includes physical,
  profile and underway data collected aboard the ROGER REVELLE during cruise RR1603
  in the Indian Ocean and Southern Oceans (> 60 degrees South) from 2016-02-08 to
  2016-03-16. These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT
  (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE.
  The instruments used to collect these data include ADCP, CTD and GPS. These data
  were collected by Alison Macdonald of Woods Hole Oceanographic Institution, and
  by University of California - San Diego; Scripps Institution of Oceanography as
  part of GO-SHIP/Climate Variability and Predictability (CLIVAR) I08S. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NCEI as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
  accession.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
